import Customer from '../components/customer/Customer';
import Loans from '../components/customer/Loans';
import React, { Component } from 'react'
import { connect } from 'react-redux';
import { getAllUser } from '../store/services/userService';
class CustomerProfile extends Component {

    componentDidMount() {
        if (this.props.token) {
            this.props.dispatch(getAllUser(this.props.token));
            console.log(this.props.users)
        }
        else {
            return (<div>
                <h2 className="bg-dark">Login Not Succesfull!!</h2>
                <button className="btn btn-warning" onClick={() => { this.props.history.push("/login") }}>Try Again!</button>
            </div>);

        }
    }

    render() {
        console.log(this.props);

        return (
            <div>
                <div className="container mt-5 bg-dark">
                    {(this.props.token) &&
                        <h1 className="mt-5 bg-dark">Login Successful</h1>
                    }

                </div>
            </div>
        )
    }
}

const mapStateToProps = (state) => {
    console.log('state = ',state);
    console.log('users = ',state.users);
    console.log('token = ',state.token , state.users.token)
    return {
        ...state
    }
}

export default connect(mapStateToProps)(CustomerProfile);
